import{_ as e,a as r,b as a,c as t,d as o,e as n,f as i}from"./chunks/qgc_set_usavcan_sub_bat.C6xi6Ob5.js";import{_ as l,c as s,o as c,ab as p}from"./chunks/framework.CUflZczI.js";const U=JSON.parse('{"title":"CAUV CAN PMU","description":"","frontmatter":{},"headers":[],"relativePath":"en/dronecan/cuav_can_pmu.md","filePath":"en/dronecan/cuav_can_pmu.md"}'),h={name:"en/dronecan/cuav_can_pmu.md"},u=p('<h1 id="cauv-can-pmu" tabindex="-1">CAUV CAN PMU <a class="header-anchor" href="#cauv-can-pmu" aria-label="Permalink to &quot;CAUV CAN PMU&quot;">​</a></h1><p>CAN PMU<sup>®</sup> is a high-precision <a href="./">DroneCAN</a> power module developed by CUAV<sup>®</sup>. It runs the CUAV ITT compensation algorithm, which enables drones to get the battery data more accurately.</p><p><img src="'+e+'" alt="CAN PMU"></p><p>It is recommended for use in large commercial vehicles, but might also be used for research vehicles.</p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://store.cuav.net/index.php" target="_blank" rel="noreferrer">CUAV store</a></li><li><a href="https://www.aliexpress.com/item/4000369700535.html" target="_blank" rel="noreferrer">CUAV aliexpress </a></li></ul><h2 id="hardware-specifications" tabindex="-1">Hardware Specifications <a class="header-anchor" href="#hardware-specifications" aria-label="Permalink to &quot;Hardware Specifications&quot;">​</a></h2><ul><li><strong>Processor:</strong> STM32F412</li><li><strong>Voltage input</strong>: 6~62V(2-15S)</li><li><strong>Max current:</strong> 110A</li><li><strong>Voltage accuracy:</strong> ±0.05V</li><li><strong>Current accuracy:</strong> ±0.1A</li><li><strong>Resolution:</strong> 0.01A/V</li><li><strong>Max output power:</strong> 6000W/90S</li><li><strong>Max stable power:</strong> 5000W</li><li><strong>Power port output:</strong> 5.4V/5A</li><li><strong>Operating temp:</strong> -20~+100</li><li><strong>Firmware upgrade:</strong> Supported.</li><li><strong>Calibration:</strong> Not needed.</li><li><strong>Interface Type:</strong><ul><li><strong>IN/OUT:</strong> XT90(Cable）/Amass 8.0(Module）</li><li><strong>Power port:</strong> 5025850670</li><li><strong>CAN:</strong> GHR-04V-S</li></ul></li><li><strong>Appearance:</strong><ul><li><strong>Size:</strong> 46.5mm * 38.5mm * 22.5mm</li><li><strong>Weight:</strong> 76g</li></ul></li></ul><h2 id="hardware-setup" tabindex="-1">Hardware Setup <a class="header-anchor" href="#hardware-setup" aria-label="Permalink to &quot;Hardware Setup&quot;">​</a></h2><h3 id="package-contents" tabindex="-1">Package Contents <a class="header-anchor" href="#package-contents" aria-label="Permalink to &quot;Package Contents&quot;">​</a></h3><p><img src="'+r+'" alt="CAN PMU list"></p><h3 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h3><p><img src="'+a+'" alt="CAN PMU"></p><p><img src="'+t+'" alt="CAN PMU"></p><h2 id="wiring" tabindex="-1">Wiring <a class="header-anchor" href="#wiring" aria-label="Permalink to &quot;Wiring&quot;">​</a></h2><p><img src="'+o+'" alt="CAN PMU"></p><p>The connection steps are:</p><ul><li>Connect the flight control CAN1/2 and the module CAN interface.</li><li>Connect the V5 series power cable to the V5 Flight Control Power2 (if other flight controllers are connect to the Power interface) and the module Power interface.</li></ul><h2 id="flight-controller-setup" tabindex="-1">Flight Controller Setup <a class="header-anchor" href="#flight-controller-setup" aria-label="Permalink to &quot;Flight Controller Setup&quot;">​</a></h2><p>Set the following parameters in <em>QGroundControl</em> <a href="./../advanced_config/parameters.html">Vehicle Setup &gt; Parameters</a> and then restart:</p><ul><li><p><a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a>: set to: <em>Sensors Automatic Config</em></p><p><img src="'+n+'" alt="qgc set"></p></li><li><p><a href="./../advanced_config/parameter_reference.html#UAVCAN_SUB_BAT">UAVCAN_SUB_BAT</a>: set to: <em>Raw data</em></p><p><img src="'+i+'" alt="QGC - Set UAVCAN_SUB_BAT parameter to raw data"></p></li></ul><h2 id="further-information" tabindex="-1">Further Information <a class="header-anchor" href="#further-information" aria-label="Permalink to &quot;Further Information&quot;">​</a></h2><p><a href="http://manual.cuav.net/power-module/CAN-PMU.pdf" target="_blank" rel="noreferrer">CAN PMU Manual</a></p><p><a href="http://doc.cuav.net/power-module/can-pmu/en/" target="_blank" rel="noreferrer">CAN PMU Power detection module &gt; Enable CAN PMU &gt; PX4 firmware</a> (CUAV docs)</p>',24),m=[u];function d(g,_,f,A,C,P){return c(),s("div",null,m)}const N=l(h,[["render",d]]);export{U as __pageData,N as default};
